package LinkedList;

import java.util.LinkedList;

public class AddLast {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		LinkedList<String>obj=new LinkedList<String>();
		obj.add("hai");
		obj.add("hello");
		obj.add("hoooi");
		obj.add("sree");
		obj.add("lakshmi");
		System.out.println(obj);
		obj.addLast("devu");
		System.out.println(obj);
		
	}

}
